import React from 'react'
import style from './header.module.css'
// import { Link } from 'react-router-dom'

const Header = () => {
    return(
            <header className="w-full flex justify-left p-8 bg-[#2C2C2C] items-center ">
            <span className={`${style.fonts} ${style.logo_font}`}>Михайло Грушевський</span>
                <nav className="py-2 px-8 w-[25rem] h-auto flex justify-between items-center rounded-[3rem] text-white select-none font-medium">
                    <span className="cursor-pointer hover:text-gray-500 duration-500">Home</span>
                    <span className="cursor-pointer hover:text-gray-500 duration-500">Category 1</span>
                    <span className="cursor-pointer hover:text-gray-500 duration-500">Category 2</span>
                    <span className="cursor-pointer hover:text-gray-500 duration-500">Category 3</span>
                </nav>
            </header>
    )
}

export default Header;
